CREATE TABLE country_names(
    id SERIAL NOT NULL PRIMARY KEY, -- SERIAL, autoincrementing four-byte integer - that's more than enough
    country_name VARCHAR (150) NOT NULL --VARCHAR - universally, but it could be TEXT also
);

CREATE TABLE country_capital_names (
    id SERIAL NOT NULL PRIMARY KEY,
    country_capital_name VARCHAR (150) NULL,
    country_id INT REFERENCES country_names(id),
	UNIQUE(country_id)
);

CREATE TABLE country_leaders (
    id  SERIAL NOT NULL PRIMARY KEY,
    country_id INT REFERENCES country_names(id),
    leader_position VARCHAR (100)  NULL,
    leader_name VARCHAR (150) NULL,
	UNIQUE(country_id)
);

CREATE TABLE countries_by_military_block (
    id SERIAL NOT NULL PRIMARY KEY,
    country_id INT REFERENCES country_names(id),
    military_block_name VARCHAR (50) NULL,
	UNIQUE(country_id) -- 1:1 relationship
);

CREATE TABLE countries_by_population (
    id SERIAL NOT NULL PRIMARY KEY,
    country_id INT REFERENCES country_names(id),
    population BIGINT CHECK(population > 0), --BIGINT for possible bigdata here...
	UNIQUE(country_id)
);

CREATE TABLE political_indicators (
    id SERIAL NOT NULL PRIMARY KEY,
    country_id INT REFERENCES country_names(id),
    electoral_process_and_pluralism INT NULL,
    functioning_of_government INT NULL,
    political_participation INT NULL,
    political_culture INT NULL,
    civil_liberties INT NULL,
    rank_value INT NULL,
    political_rights INT NULL,
    index_of_press_freedom INT NULL,
	UNIQUE(country_id)
);
CREATE TABLE person_basic_info (
    id SERIAL NOT NULL PRIMARY KEY,
    gender VARCHAR (7) NOT NULL,
    first_name VARCHAR (150) NULL,
    last_name VARCHAR (150) NULL,
    email VARCHAR (150) NULL,
    iq_level INT NULL CHECK(iq_level > 40)
);

CREATE TABLE persons_features (
    id SERIAL NOT NULL PRIMARY KEY,
	dominate_feature VARCHAR (50) NULL , 
	person_id INT NOT NULL REFERENCES person_basic_info(id)
);

CREATE TABLE political_views (
    id SERIAL NOT NULL PRIMARY KEY,
	political_view VARCHAR (100) NULL , 
	person_id INT NOT NULL REFERENCES person_basic_info(id)
);

CREATE TABLE political_revolution_campaigns (
    id SERIAL NOT NULL PRIMARY KEY,
    country_id INT NULL,
    begin_date DATE NULL,
    end_date DATE NULL,
    reason_id INT NOT NULL,
    success INT NULL,
    participants_min_max BIGINT NULL,
    participants_max_max BIGINT NULL,
	CONSTRAINT political_revolution_campaigns_country_names_fkey FOREIGN KEY (country_id) REFERENCES country_names(id),
	CHECK (participants_min_max > 0 AND participants_max_max > participants_min_max)
);

CREATE TABLE political_revolutions_reasons (
    id SERIAL NOT NULL PRIMARY KEY,
    revolution_campaign_reason VARCHAR (50) NULL
);

CREATE TABLE political_multiple_reasons (
    id_reason  INT NOT NULL,
    id_country INT NOT NULL,
    CONSTRAINT political_multiple_reasons_pkey PRIMARY KEY (id_reason, id_country),
    CONSTRAINT political_multiple_reasons_political_revolutions_reasons_fkey FOREIGN KEY (id_reason) REFERENCES political_revolutions_reasons(id),
    CONSTRAINT political_multiple_reasons_country_names_fkey FOREIGN KEY (id_country) REFERENCES country_names (id)
);


